value.raw:
& {
	all: unset;
	cursor: pointer;
	outline: revert;
	background: linear-gradient(
		to right,
		light-dark(violet, darkViolet),
		light-dark(magenta, rebeccaPurple)
	);
	padding: .1em .5em;
	border-radius: .3em;
	color: white;
	font-weight: 600;
	letter-spacing: .05em;
}

value.cooked:
& {
	all: unset;
	cursor: pointer;
	outline: revert;
	background: linear-gradient(
		to right,
		light-dark(violet, darkViolet),
		light-dark(magenta, rebeccaPurple)
	);
	padding: .1em .5em;
	border-radius: .3em;
	color: white;
	font-weight: 600;
	letter-spacing: .05em;
}

value.raw:
body {
	padding: .8rem 1rem;
}

hr {
	block-size: 1px;
	border: none;
	background-color: #888;
}

